const NavbarMenu = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        < NavbarItem label="Logo"/>
      </div>
      <ul className="navbar-menu">
        <NavbarItem label="About" />
        <NavbarItem label="Work" />
        <NavbarItem label="Contact" />
